contracts/MyNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";

contract Heavenlywords is ERC721URIStorage, Ownable {
    
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;
    
    
    // -> contract variables
    bool public paused = false;
    uint256 public maxSupply = 7777;
    uint256 public cost = 0.111 ether;
    string public initialURI = 'https://gateway.pinata.cloud/ipfs/QmWqhSGR2eC9bD7ocoEMpNnGRZK875yWxgExwfgm9QVejp';
    address public contractOwner;
    mapping (address => bool) public admins;
    mapping (uint256 => string) public idToImageDesc;
    

    // -> contract constructor
    constructor() ERC721("Heavenlywords", "HWs") {
        contractOwner = msg.sender;
        admins[msg.sender] = true;
    }


    // -> modifiers
    // modifier onlyOwner {
    //     require(msg.sender == contractOwner);
    //     _;
    // }

    modifier onlyAdmin {
        require(admins[msg.sender]);
        _;
    }


    // -> contract methods
    function mint(address _recipient, string memory _imageDesc)
        public 
        payable
        returns (uint256)
    {
        require(!paused, 'Minting is paused');
        
        if (msg.sender != contractOwner)
        {
            require(msg.value >= cost, 'Not enough ETH sent; check price!');
        }

        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();
        require(newItemId <= maxSupply);
        
        _mint(_recipient, newItemId);
        _setTokenURI(newItemId, initialURI);
        idToImageDesc[newItemId] = _imageDesc;
        return newItemId;
    }


    function contractURI() 
        public 
        view 
        returns (string memory) {
        return "https://gateway.pinata.cloud/ipfs/QmVtu2dU56B7TCmkFFCBM8CAkwTRbVFvU3LwUH6Kp9kcw1";
    }
    
    
    function updateURIs(uint256[] memory _IDs, string[] memory _URIs)
        public
        onlyAdmin
    {
        require(_IDs.length == _URIs.length);
        for(uint256 i = 0; i < _IDs.length; i++)
        {
            _setTokenURI(_IDs[i], _URIs[i]);
        }
    }
    
    
    function updateOneURI(uint256 _ID, string memory _URI)
        public
        onlyAdmin
    {
        _setTokenURI(_ID, _URI);
    }


    function withdraw(uint256 _amount)
        public
        onlyOwner
    {
        payable(msg.sender).transfer(_amount);
    }
    
    
    
    function transfer(address payable _addr, uint256 _amount) 
        public
        onlyOwner
    {
        _addr.transfer(_amount);
    }
    
    
    function getBalance() 
        public 
        view 
        onlyAdmin
        returns(uint256) 
    {
        return(address(this).balance);
    }


    function getInitialURI()
        public
        view
        returns(string memory)
    {
        return initialURI;
    }


    function setInitialURI(string memory _newURI)
        public
        onlyAdmin
    {
        initialURI = _newURI;
    }


    function getMaxSupply()
        public
        view
        returns(uint256)
    {
        return maxSupply;
    }


    function setMaxSupply(uint256 _value)
        public
        onlyOwner
    {
        maxSupply = _value;
    }


    function getOwner()
        public
        view
        returns(address)
    {
        return contractOwner;
    }


    function getPaused()
        public
        view
        returns(bool)
    {
        return paused;
    }
    
    
    function setPaused(bool _value)
        public
        onlyAdmin
    {
        paused = _value;
    }
    

    function getCost()
        public
        view
        returns(uint256)
    {
        return cost;
    }
    
    
    function setCost(uint256 _newCost) 
        public
        onlyOwner
    {
        cost = _newCost;
    }
    
    
    function getMintCount()
        public 
        view
        onlyAdmin
        returns(uint256)
    {
        return _tokenIds.current();
    }
    
    
    function getImageDescById(uint256 _id)
        public
        view
        returns(string memory)
    {
        return idToImageDesc[_id];
    }


    function setAdmin(address _addr)
        public
        onlyOwner
    {
        admins[_addr] = true;
    }


    function removeAdmin(address _addr)
        public
        onlyOwner
    {
        admins[_addr] = false;
    }


    function isAdmin(address _addr)
        public
        view
        returns(bool)
    {
        return admins[_addr];
    }
    
}

